        "Observa\u00e7\u00e3o": "Atendimento:-2\u00aa a 6\u00aa feira, das 9h \u00e0s 12h e das 14h \u00e0s 18h.A ARIN tem por finalidade gerenciar a pol\u00edtica de rela\u00e7\u00f5es internacionais para a cidade de Curitiba, em conjunto com os demais \u00f3rg\u00e3os municipais, com atua\u00e7\u00e3o nos eixos das rela\u00e7\u00f5es bilaterais e multilaterais, coopera\u00e7\u00e3o t\u00e9cnica descentralizada e protocolo internacional, tendo as seguintes atribui\u00e7\u00f5es: Atender delega\u00e7\u00f5es internacionais oficiais e t\u00e9cnicas., Acompanhar acordos entre cidades-irm\u00e3s e demais parceiras, por meio de protocolos de coopera\u00e7\u00e3o t\u00e9cnica., Desenvolver interfaces com o Minist\u00e9rio das Rela\u00e7\u00f5es Exteriores, Embaixadas, Consulados e organiza\u00e7\u00f5es internacionais., Elaborar notas t\u00e9cnicas e fornecer suporte t\u00e9cnico e lingu\u00edstico \u00e0s miss\u00f5es oficiais do Prefeito e Secret\u00e1rios que o representem no exterior e em eventos de car\u00e1ter internacional., Dar suporte \u00e0s Secretarias / \u00d3rg\u00e3os na condu\u00e7\u00e3o de projetos de coopera\u00e7\u00e3o internacional., Representar, em conjunto com as demais Secretarias / \u00d3rg\u00e3os, os assuntos de relev\u00e2ncia internacional nas redes internacionais de cidades.",
